const AppRoute = ({component:Component, layout:Layout, title:Title, ...rest})=>
(
    <Route {...rest} render={props=>(
        <Layout>
            <Component {...props}></Component>
        </Layout>
    )}>

    </Route>
)

class App extends Component{
  constructor(props){
    super(props);
  }

  render(){
    return(
      <div>
        <Router>
            <Switch>
              {/* Dashboard */}
                <AppRoute path='/' layout={Layout} exact title="Dashboard Pengunjung" component={Pengunjung} />
                <AppRoute path='/dashboard/pengunjung' layout={Layout} component={Pengunjung} />
                <AppRoute path='/dashboard/pengguna' layout={Layout} component={Pengguna} />
            </Switch>
        </Router>
      </div> 
    );
  }
}

export default App;
